/** @format */

import React, { Fragment } from "react";
import {
  Box,
  Switch,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Typography,
} from "@mui/material";
import { LinkButton } from "../../styles/styles";

import { useToggle } from "../../context/useToggle";

const Filters = () => {
  const [paid, setPaid] = useToggle(false);
  const label = { inputProps: { "aria-label": "Switch demo" } };

  const [age, setAge] = React.useState("");

  const handleChange = (event) => {
    setAge(event.target.value);
  };

  return (
    <Fragment>
      <Box
        p={3}
        sx={{
          "& .MuiTextField-root": { m: 1 },
        }}
      >
        <LinkButton to="/create-invoice">Create Invoice</LinkButton>
        <LinkButton to="/create-invoice">Receive Money</LinkButton>
        <Switch
          checked={paid}
          onChange={() => setPaid(paid)}
          {...label}
          // defaultChecked
        />
        <FormControl sx={{ width: "8rem", mr: 2 }}>
          <InputLabel id="demo-simple-select-label">All Invoice</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={age}
            label="Age"
            onChange={handleChange}
          >
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
        <FormControl sx={{ width: "8rem", mr: 2 }}>
          <InputLabel id="demo-simple-select-label">Bill Date</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={age}
            label="Age"
            onChange={handleChange}
          >
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
        <FormControl sx={{ width: "8rem" }}>
          <InputLabel id="demo-simple-select-label">All Times</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={age}
            label="Age"
            onChange={handleChange}
          >
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
        <Typography component="span" variant="h8" sx={{ width: "8rem", m: 2 }}>
          {" "}
          Status:{" "}
        </Typography>

        <FormControl sx={{ width: "8rem", mr: 2 }}>
          <InputLabel id="demo-simple-select-label">Any </InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={age}
            label="Age"
            onChange={handleChange}
          >
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
        <FormControl sx={{ width: "8rem", mr: 2 }}>
          <InputLabel id="demo-simple-select-label">Dropdown</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={age}
            label="Age"
            onChange={handleChange}
          >
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
      </Box>
    </Fragment>
  );
};

export default Filters;
